import User from './User'

const UserList = ({users, onClickUserEdit, onFormSubmit}) => {
    return (
        <>
            {users.map(
                (user) => <User key={user.id} user={user} onClickUserEdit = {onClickUserEdit} />
            )}
        </>
    )
}

export default UserList
